{
    pIPort->pfnUpdateDisplay       = dummyUpdateDisplay;
    pIPort->pfnUpdateDisplayAll    = dummyUpdateDisplayAll;
    pIPort->pfnQueryColorDepth     = dummyQueryColorDepth;
    pIPort->pfnSetRefreshRate      = dummySetRefreshRate;
    pIPort->pfnDisplayBlt          = dummyDisplayBlt;
    pIPort->pfnUpdateDisplayRect   = dummyUpdateDisplayRect;
    pIPort->pfnCopyRect            = dummyCopyRect;
    pIPort->pfnSetRenderVRAM       = dummySetRenderVRAM;

    gDummyMonitor.pConnector = pConnector;
    return 0;
}
